import React, {useState} from 'react';

const RightBlock = () => {
    let main = '1111   Lorem ipsum dolor sit amet,' +
        ' consectetur adipisicing elit. Blanditiis' +
        ' dolorem earum illo inventore quibusdam' +
        ' repellat similique tempora voluptate! Dolor' +
        '' +
        ' doloremque earum et facere maiores porro ut.' +
        ' Dicta doloribus ipsa nulla quam? Fuga quos tempore' +
        ' voluptatibus! Architecto assumenda at explicabo fuga modi quod' +
        ' repellendus reprehenderit! Cumque maxime minus non quo reprehenderit?  1111'
    const [state, setState] = useState(main)
    return (
        <div className={'rightBlock'}>
            <div className={'headerImage'}>
                <div className={'grad'}></div>
            </div>
            <div>
                {state}
            </div>
        </div>
    );
};

export default RightBlock;
